import React from 'react';
import img1 from '../../images/photo3.jpeg';

const imgStyle = {
    display: 'block',
    margin: '0 auto',
    width: '50%',
    height: 'auto',
    borderRadius: '50%',
    align: 'center',
    marginTop: '10 em'
};


export default ({ input, key, label, cImage, cText}) => {
	return (
		<div className="col s4">
				<div className="card teal white-text" key={key}>
                    <div className="card-image">
                        <img style={imgStyle} src={img1} />
                    </div>
					<div className="card-content">
						<span className="card-title">{label}</span>
						<p>{cText}</p>
					</div>
				</div>
                </div>
	);
};
